chunkIntoColumns = function(items, size) {
  var cols, i, j, len, ref;
  cols = [];
  ref = range(0, items.length, size);
  for (j = 0, len = ref.length; j < len; j++) {
    i = ref[j];
    cols.push(items.slice(i, i + size));
  }
  return cols;
};

